import React from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

function Body(props) {
  return (
    <div>
      <Container>
        <Row>
          <Col className="text">
            {props.title && (
              <h1 style={{ "margin-bottom": "64px" }}>{props.title}</h1>
            )}
            {props.subTitle && (
              <h3 style={{ "margin-bottom": "64px" }}>{props.subTitle}</h3>
            )}
            {props.text && <h4>{props.text}</h4>}
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Body;
